import React, { useState } from 'react'

function useStateHook() {
    const [count, setCount] = useState[0]
    return (
        <div>
            <p>{count}</p>
            <button onClick={() => setCount(count + 1)}>Click me</button>
        </div>
    )
}

export default useStateHook
